import React from 'react';

import { 
  Card,
  CardTitle,
  CardSubTitle,
  CardButtons,
  Members, 
  CardForm, 
} from '../UI/Card/Card';
import MiniButton from '../UI/MiniButton/MiniButton';
import LineInput from '../UI/LineInput/LineInput';

const CreateProjectForm = (props) => {
  return (
    <Card>
      <CardTitle>Добавление проекта</CardTitle>
      
      <LineInput type="text" placeholder="Название проекта"/>
      
      <CardForm>
        <CardButtons>
          
          <MiniButton onClick={props.onClick}>
            Добавить
          </MiniButton>
        </CardButtons>
      </CardForm>
    </Card>
  )
};

export default CreateProjectForm;
